import React, { Component } from "react";
import Header from "../../../component/header";
import { findByid } from "../../../action/units";
import UnitPageList from "../UnitPageList";
export class UnitPage extends Component {
  constructor(props) {
    super(props);

    this.state = {
      id: null,
      name: null
    };
  }

  componentDidMount() {
    const { match } = this.props;
    const data = findByid(match.params.id);
    this.setState({ ...data });
  }
  render() {
    const { data } = this.state;
    return (
      <div>
        <Header>
          {console.log(data)}
          this is unit page with id: {JSON.stringify(this.state, 0, 2)}.
        </Header>
      </div>
    );
  }
}

export default UnitPage;
